import Navbar from './components/Navbar';
import './App.css';
import { Routes,Route, BrowserRouter,Router } from 'react-router-dom';
import Home from './components/Home';
import About from './components/About';
import Genderchart from './components/Genderchart';
import Category from './components/Category';
import Sidenav from './components/Sidenav';
function App() {
  return (
    <>
    <Router>
      <Sidenav/>
    </Router>
    <div className="App">
     <BrowserRouter>
     <Navbar/>
     <Routes>
      <Route  id="root" path='/home' element={<Home/>}/>
      <Route  id="root" path='/about' element={<About/>}/>
      <Route id="root" path='/genderchart' element={<Genderchart/>}/>
      <Route  id="root" path='/category' element={<Category/>}/>
     </Routes>
     </BrowserRouter>
    </div>
    </>
  );
}

export default App;
